--
-- Table structure for table `products`
--

DROP TABLE IF EXISTS `products`;
/*!40101 SET @saved_cs_client     = @@character_set_client */;
/*!40101 SET character_set_client = utf8 */;
CREATE TABLE `products` (
  `id` int unsigned NOT NULL AUTO_INCREMENT,
  `name` varchar(255) CHARACTER SET utf8 COLLATE utf8_unicode_ci NOT NULL COMMENT 'Название',
  `price` decimal(11,2) NOT NULL COMMENT 'Цена',
  `seller_id` int unsigned NOT NULL,
  `city_id` int unsigned NOT NULL,
  `size_id` int unsigned NOT NULL,
  `category_id` int unsigned NOT NULL,
  `filter_id` int unsigned NOT NULL,
  `description` text COLLATE utf8_unicode_ci,
  `manufacturing_time` time NOT NULL COMMENT 'Время изготовления',
  `delivery_time` time NOT NULL COMMENT 'Время доставки',
  `created_at` datetime DEFAULT CURRENT_TIMESTAMP,
  `updated_at` datetime DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP,
  PRIMARY KEY (`id`),
  KEY `products_size_id_fk` (`size_id`),
  KEY `products_city_id_fk` (`city_id`),
  KEY `products_filter_id_fk` (`filter_id`),
  KEY `products_seller_id_fk` (`seller_id`),
  KEY `products_category_id_fk` (`category_id`),
  KEY `products_category_id_idx` (`category_id`),
  KEY `products_city_id_idx` (`city_id`),
  CONSTRAINT `products_category_id_fk` FOREIGN KEY (`category_id`) REFERENCES `category_products` (`id`),
  CONSTRAINT `products_city_id_fk` FOREIGN KEY (`city_id`) REFERENCES `cities` (`id`),
  CONSTRAINT `products_filter_id_fk` FOREIGN KEY (`filter_id`) REFERENCES `product_filters` (`id`),
  CONSTRAINT `products_seller_id_fk` FOREIGN KEY (`seller_id`) REFERENCES `sellers` (`id`),
  CONSTRAINT `products_size_id_fk` FOREIGN KEY (`size_id`) REFERENCES `sizes` (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=101 DEFAULT CHARSET=utf8 COLLATE=utf8_unicode_ci;
/*!40101 SET character_set_client = @saved_cs_client */;

